  \"Counts of Alaska Steller sea lion pups conducted on rookeries in Alaska from 1961-06-22
  to 2014-07-09 (NCEI Accession 0128189)\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-02-26T22:16:45.719993\",\n\t\"name\": \"counts-of-alaska-steller-sea-lion-pups-conducted-on-rookeries-in-alaska-from-1961-06-22-to\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This database contains counts of Steller
  sea lion pups on rookeries in Alaska made between 1961 and 2014. Pup counts are
  conducted in late June-July. Pups are counted from the ground (by walking along
  the rookery), from cliff-side overlooks, and from aerial images (oblique and vertical
  orientation). Pup counts conducted in late June-mid July are considered to represent
  a complete census of pups produced at each site during the year.\",\n\t\"license_title\":
